import React from "react";
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";

const App = () => {
  return (
    <>
      <div class="container-fluid p-0">
        <Navbar />
        <div class="row">
          <div class="col-3">
            <Sidebar />
          </div>
          <div class="col-9">2 of 2</div>
        </div>
      </div>
    </>
  );
};

export default App;
